/**
 * Main Application Component
 * 
 * Sets up the application routing structure:
 * - Public routes (home, listings, auth)
 * - Protected routes (dashboard, bookings)
 * - Wraps all routes in a common layout
 */

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ROUTES } from './constants/routes';
import Layout from './components/Layout';
import HomePage from './pages/HomePage';
import { ListingsPage } from './pages/ListingsPage';
import ListingDetailPage from './pages/ListingDetailPage';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import UserDashboardPage from './pages/UserDashboardPage';
import AgentDashboardPage from './pages/AgentDashboardPage';
import AdminDashboardPage from './pages/AdminDashboardPage';
import BookingManagementPage from './pages/BookingManagementPage';
import RequireRole from './components/RequireRole';

function App() {
  return (
    <Router>
      <Layout>
        <Routes>
          {/* Public Routes */}
          <Route path={ROUTES.HOME} element={<HomePage />} />
          <Route path={ROUTES.LISTINGS} element={<ListingsPage />} />
          <Route path={ROUTES.LISTING_DETAIL} element={<ListingDetailPage />} />
          <Route path={ROUTES.LOGIN} element={<LoginPage />} />
          <Route path={ROUTES.SIGNUP} element={<SignupPage />} />
          <Route path={ROUTES.UNAUTHORIZED} element={<UnauthorizedPage />} />

          {/* Protected Routes */}
          <Route 
            path={ROUTES.DASHBOARD}
            element={
              <RequireRole role="user">
                <UserDashboardPage />
              </RequireRole>
            } 
          />
          <Route 
            path={ROUTES.DASHBOARD_AGENT}
            element={
              <RequireRole role="agent">
                <AgentDashboardPage />
              </RequireRole>
            } 
          />
          <Route 
            path={ROUTES.DASHBOARD_ADMIN}
            element={
              <RequireRole role="admin">
                <AdminDashboardPage />
              </RequireRole>
            } 
          />
          <Route 
            path={ROUTES.DASHBOARD_BOOKINGS}
            element={
              <RequireRole role="agent">
                <BookingManagementPage />
              </RequireRole>
            } 
          />
          <Route 
            path={ROUTES.DASHBOARD_PROPERTIES}
            element={
              <RequireRole roles={['agent', 'admin']}>
                <div>Properties Dashboard - Coming Soon</div>
              </RequireRole>
            } 
          />
          <Route 
            path={ROUTES.DASHBOARD_SETTINGS}
            element={
              <RequireRole roles={['user', 'agent', 'admin']}>
                <div>User Settings - Coming Soon</div>
              </RequireRole>
            } 
          />
        </Routes>
      </Layout>
    </Router>
  );
}

export default App;
